import math
from functools import reduce

def minimal_jump_cost(n, l, c):
    element = l[0]
    for i in range(1, n):
        element = math.gcd(element, l[i])
    if element == 1:
        return -1
    myset = {}
    for (ind, i) in enumerate(l):
        for j in list(myset):
            temp = math.gcd(j, i)
            if temp not in myset:
                myset[temp] = myset[j] + c[ind]
            else:
                myset[temp] = min(myset[temp], c[ind] + myset[j])
        if i not in myset:
            myset[i] = c[ind]
        else:
            myset[i] = min(myset[i], c[ind])
    return myset[1]

